import React, { useEffect, useState } from 'react';
import NavBar from './navbar';
import ApiService from './apiService';

function Events() {
  const [businesses, setBusinesses] = useState(null);  // State to store businesses data

  useEffect(() => {
    const fetchBusinesses = async () => {
      const data = await ApiService();  // Fetch data using ApiService
      setBusinesses(data);  // Set businesses data
    };

    fetchBusinesses();  // Fetch businesses when component mounts
  }, []);  // Empty dependency array for one-time execution

  return (
    <div>
      <NavBar />
      <h1>Events</h1>
      {businesses ? (
        <div>
          {businesses.map((business, index) => (
            <div key={index}>
              <h3>{business.name}</h3>  // Display business name
              {/* Add other business details if needed */}
            </div>
          ))}
        </div>
      ) : (
        <div>Loading...</div>  // Display while fetching data
      )}
    </div>
  );
}

export default Events;
